column8:
ざっくりとした風合いのニットが可愛い、アラン編みの定番アイテム襟付きカーディガン！<br>
長い時間をかけて編みこまれ、洗練された飾り編みのニットはとても暖かく、ファッション<br>
性の高い冬のマストアイテム。インナーにはボーダーでシンプルな雰囲気のカットソーから<br>
シャツまで幅広いファッションが提案出来ます。定番のCABLESと呼ばれる種類の編みこみ<br>
製法で、合わせ易く流行りすたりのない一生物のアイテムです。カジュアルなスタイルから<br>
きれいめなスタイルまで幅広く対応できるアイテムです。<br><br>

ニット職人が1枚1枚手で編みこんでいるため、同じサイズでも若干のばらつきがございます。<br>
予めご了承ください。 原産国：スコットランド ■素材 ウール１００％<table width="100%" cellspacing="2" cellpadding="0" border="0">
