保温だけでなく、発熱効果のある最新テクノロジーを用いた特殊レーヨンを使用。<br />
人体から常に発散されている蒸気などの水分に反応して繊維が素早く発熱、また持続します。<br />
余分な湿気を放出する機能も持ち合わせているので、暖かいだけでなく、快適な着心地も保てます。<br />
おたふく手袋：JW-161 jw161

